import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
// import './Navbar.css';

function AdminNavbar() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };
  useEffect(() => {
    showButton();
  }, []);
  window.addEventListener("resize", showButton);
  return (
    <>
      <nav
        className="navbar navbar-expand navbar-dark bg-dark"
        style={{ borderRadius: "20px" }}
      >
        <Link to={"/"} className="navbar-brand">
          Green Car Wash
        </Link>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/"} className="nav-link">
              Home
            </Link>
          </li>

          <li className="nav-item">
            <Link to={"/admin_pack"} className="nav-link">
              Packages
            </Link>
          </li>
          <li className="nav-item">
            <Link to={"/washersignUp"} className="nav-link">
              Add Washer
            </Link>
          </li>
          <li className="nav-item">
            <Link to={"/Profile"} className="nav-link">
              User Profiles
            </Link>
          </li>
          <li className="nav-item">
            <Link to={"/WasherProfile"} className="nav-link">
              Washer Profiles
            </Link>
          </li>

          <li className="nav-item">
            <Link to={"/addpacks"} className="nav-link">
              Add Packages
            </Link>
          </li>
        </div>

        <div className="ms-auto pe-md-5 navbar-nav">
          <li className="nav-item">
            <Link to="/adminlog" className="nav-link">
              Logout
            </Link>
          </li>
        </div>
      </nav>
    </>
  );
}
export default AdminNavbar;
